  const AuthCtx = useContext(AuthContext)

  return (
    <AuthContextProvider>
      <div className={style.main}>
        <Navbar></Navbar>
        <div className={style["content-container"]}>
          {AuthisLogedIn? <LoginForm /> : <div/>}
        </div>
      </div>
    </AuthContextProvider>
